import React from "react";
// @ts-ignore
import Gallery from "react-grid-gallery";

import bgimg1 from "../../image/bgimg1.jpg";
import bgimg3 from "../../image/bgimg3.png";
import bgimg4 from "../../image/bgimg4.jpg";
import bgimg5 from "../../image/bgimg5.jpg";

export default function Imagepage() {
  const PHOTOS = [
    {
      src: { bgimg1 },
      thumbnail: { bgimg1 },
      thumbnailWidth: 100,
      thumbnailHeight: 30,

      tags: [
        { value: "Ocean", title: "Ocean" },
        { value: "People", title: "People" },
      ],
      caption: "Image 1",
    },
    {
      src: { bgimg4 },
      thumbnail: { bgimg4 },
      thumbnailWidth: 300,
      thumbnailHeight: 40,
      tags: [
        { value: "Ocean", title: "Ocean" },
        { value: "People", title: "People" },
      ],
      caption: "Image 2",
    },
    {
      src: { bgimg3 },
      thumbnail: { bgimg3 },
      thumbnailWidth: 120,
      thumbnailHeight: 70,
      tags: [
        { value: "Ocean", title: "Ocean" },
        { value: "People", title: "People" },
      ],
      caption: "Image 3",
    },
    {
      src: { bgimg5 },
      thumbnail: { bgimg5 },
      thumbnailWidth: 320,
      thumbnailHeight: 212,
      tags: [
        { value: "Ocean", title: "Ocean" },
        { value: "People", title: "People" },
      ],
      caption: "Image 4",
    },
  ];
  return (
    <div style={{ height: "700px", paddingTop: "50px" }}>
      <Gallery images={PHOTOS} />
    </div>
  );
}
